import React, {useState} from 'react';

const SearchBar = () => {
  const [emojiEntry, setEmojiEntry] = useState('')

  const onFormSubmit = e => {
    e.preventDefault()
  }

  return (
    <div>
      <form
        value={(e)=>onFormSubmit(e)}
      >

        <input
          type='text'
          value ={emojiEntry}
          onChange={value => setEmojiEntry(value)}
        >

        </input>
      </form>
    </div>
  )
}
export default SearchBar
